Dualistic Nature - Industrial Music (Videos)

Dualistic Nature is an industrial act that includes raw, power-slamming, high energy, in-your-face, angry, harsh, frustrated, seething soundscapes with a nice balance of heavy beats, electronic arrangements, scorching vocals, sampled guitars and great hooks. A nice package for fans of hard industrial music. With influences from modern to old skool, the music range of noise, sound and hardness is all there for industrial music lovers. Be sure to check out the main websites for more information. This package includes the following videos:

Dualistic Nature - Before It Dies (Video)

Dualistic Nature - Burn It Down (Video)

Dualistic Nature - Forsaken (Video)

